import React from "react";
import './home.css';
import marvin_logo from './images/marvin_logo.png'

function Home() {
  return (
    <div className="home check">
      <div className="container check">
        <div className="my-5 check">
          <p className="center">Welcome to Professor Marvin - Your Simple and Effective Study Tool!</p>
          <img className="logo" src={marvin_logo} alt="Marvin Logo"></img>
          <p className="center">Simply upload some files to train Professor Marvin and interact with them as if they are your personal tutor</p>
          <form className="center" action="/upload_page">
            <button className="btn btn-go-to-upload-from-start" type="submit">Click here to get started!</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Home;
